function QualRowOne() {
  return (
    <>
<div className='container'style={{backgroundColor:"#e9214e"}}>
<div class="card rowCard  mb-3"style={{backgroundColor:"#e9214e"}} >
  <div class="card-body"style={{backgroundColor:"#e9214e"}}>
    <h5 class="card-title txt"style={{backgroundColor:"#e9214e"}}>Customer Satisfaction</h5>
    <p class="card-text txt"style={{backgroundColor:"#e9214e"}}>thorugh our great services and qualities</p>
  </div>
</div>
<div class="card rowCard  mb-3" >
  <div class="card-body"style={{backgroundColor:"#e9214e"}}>
    <h5 class="card-title txt"style={{backgroundColor:"#e9214e"}}>Competitive Rates</h5>
    <p class="card-text txt"style={{backgroundColor:"#e9214e"}}>Real Value for Money</p>
  </div>
</div>

</div>
   
    </>
  );
}

export default QualRowOne;
